    animalType: string;
}

const SaleAnimalCard: FC<SaleAnimalCardProps> = ({ animalType }) => {
    return (
        <Box textAlign="center" w={150}>
            <AnimalCard animalType={animalType}/>
            <Box></Box>
        </Box>
    );
}

export default SaleAnimalCard;
